import React, { Component } from 'react'

export default class HomePage extends Component {
    render() {
        return (
            <div>
                <h1> My Clasess</h1>
                <div class="ui four  card">
                    <a class="image" href="#">
                        <img src="/images/avatar/large/steve.jpg"/>
                    </a>
                    <div class="content">
                        <a class="header" href="#">Steve Jobes</a>
                        <div class="meta">
                        <a>Last Seen 2 days ago</a>
                        </div>
                    </div>
                 </div>

            </div>
        )
    }
}

